function wppfm_resetBackupsList(){var a=null;var b="";var c=jQuery("#wppfm-backups-list");wppfm_getBackupsList(function(d){if("0"!==d){a=JSON.parse(d);b=wppfm_backupsTable(a)}else{b=wppfm_emptyBackupsTable()}c.empty();c.append(b)})}function wppfm_resetOptionSettings(){wppfm_getSettingsOptions(function(b){if(b){var a=JSON.parse(b);jQuery("#wppfm_auto_feed_fix_mode").prop("checked",a[0]==="true");jQuery("#wppfm_background_processing_mode").prop("checked",a[3]==="true");jQuery("#wppfm_third_party_attr_keys").val(a[1]);jQuery("#wppfm_notice_mailaddress").val(a[2])}})}function wppfm_backupsTable(d){var c="";for(var b=0;b<d.length;b++){var a=d[b].split("&&");var f=a[0];var e=a[1];c+='<tr id="feed-row"';if(b%2===0){c+=' class="alternate"'}c+=">";c+='<td id="file-name">'+f+"</td>";c+='<td id="file-date">'+e+"</td>";c+='<td id="actions"><strong><a href="javascript:void(0);" onclick="wppfm_deleteBackupFile(\''+f+"')\">"+wppfm_backup_list_form_vars.list_delete+" </a>";c+='| <a href="javascript:void(0);" onclick="wppfm_restoreBackupFile(\''+f+"')\">"+wppfm_backup_list_form_vars.list_restore+" </a>";c+='| <a href="javascript:void(0);" onclick="wppfm_duplicateBackupFile(\''+f+"')\">"+wppfm_backup_list_form_vars.list_duplicate+" </a></strong></td>";c+="</tr>"}return c}function wppfm_emptyBackupsTable(){var a="";a+="<tr>";a+="<td colspan = 4>"+wppfm_backup_list_form_vars.no_backup+"</td>";a+="</tr>";return a}jQuery(document).ready(function(){wppfm_resetBackupsList()});